# Abstract

This study examines a group of people who participated in a taste test of coffee and their experience of coffee flavors. In the course of the taste test, the participants were asked to voluntarily fill out information about up to 4 coffees labeled A, B, C, and D as well as their demographics. For each coffee, the participant could score its acidity and bitterness, give it a score and finally choose their favorite if they had one. This revealed a lot of interesting data not the least of which was that people often rank acidity and bitterness of the same coffees differently. 
In order to better understand how people actually taste coffee, it is necessary to understand what contributes to the flavors of coffee. In their paper, [Acids in coffee: A review of sensory measurements and meta-analysis of chemical composition, Yeager et al](https://www.tandfonline.com/doi/figure/10.1080/10408398.2021.1957767?) describe how the variety of different acids contained within the coffee beans contribute to the overall flavor profiles of, not only different roasts, but different species of beans and different brewing methods as well. They describe how, to human senses, the acids in coffee make up 5 - 11% of the mass of each bean and are the most significant contributor to quality and flavor of coffee with even small changes largely impacting flavor profiles.
The acids are broken down into two main categories, organic acids (OAs) and chlorogenic acids (CGAs). 38 organic acids have been identified in beans with sucrose as the precursor in the green (unroasted) bean. During the roasting process, chemical reactions increase the organic acids (leading to higher organic acids in darker roasted coffees and lower sucrose levels). There have been over 30 CGAs (broken down into several other categories) identified as well. In its raw state, these contribute to the acidity of coffee but as it is roasted, they breakdown and contribute to the bitter flavor of coffee. 
As noted by Yeager et al, there are no universally recognized thresholds for which roast belongs to which category which can complicate efforts to determine how people experience different roasts and flavors in addition to individual differences in quantifying flavor and simply different palates. 





# Introduction

## The data




There are three different datasets from 2 sources. 
The [Coffee Taste Test Data](https://github.com/rfordatascience/tidytuesday/master/data/2024/2024-05-14) was compiled by a data blogger named Robert McKeon Aloe after the "Great American Coffee Taste Test" on YouTube when viewers filled out a survey about 4 coffees they had consumed. The data was voluntary and consumers of the coffees were not compelled to fill in all spaces or try all coffees so there are many NA entries but they did collect a lot of data from the viewers on both their tastes as well as demographics which makes this a great dataset.
