#### Discussion
Coffee D seems to have been the standout of the test, with coffee A getting the honorable mention. Only in the Republican group was there a different second place coffee, coffee B came in second. 

There doesn't seem to be any real correlation between political party and coffee preference. It might be interesting to repeat the experiment after removing coffee D to see if the trend grew with Republicans specifically preferring a unique coffee when compared with everyone else. Alternatively, expanding coffee preference might give interesting results as well.
